import axios from "axios";
import React, { useEffect } from "react";
function Dashboard(){
    useEffect(()=>{
       async function getData(){
            const result = await axios.get("http://localhost:8000/getstudent")
        console.log(result);
        }
       getData()
    },[])
return(
    <>
    <p>Dashboard</p>
    </>
)
}
export default Dashboard
